import ShowContent from "./components/show-content";
import { createGlobalStyle } from "styled-components";

function App() {
  return (
    <>
      <GlobalStyle />
      <ShowContent />
    </>
  );
}

const GlobalStyle = createGlobalStyle`
  *{
    margin: 0;
    padding: 0;
    text-decorantion: none;
    box-sizing: border-box;

  }
`

export default App
